import React from 'react'
import './Navbar.css'



function Navbar() {
  return (
    <div className='navbar'>
        <img className='logo' src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1920px-Netflix_2015_logo.svg.png" alt="Netflix" />
        <img className='avatar' src="https://i.pinimg.com/originals/c4/88/34/c488340ad56e5454f4576f6c708b63aa.png" alt="Avatar" />
    </div>
  )
}

export default Navbar
